INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("ほわあああぁぁ何この蝋燭！？\n思わず知的興奮で吹き消してしまったが\n怪しい残り香、興味深ぁ～！\n鼻腔から学び入ってくる～！", 5, 111011, 1110501040, 1, "", 1110501, 0, 1, 11, 0);
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", "", 0, 1110501041, "", "", 1110501, "", "", 91, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("vo_adv_1110501_001", 0, "vo_adv_1110501", 1110501042, 0, "", 1110501, "", "", 21, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 4, 111011, 1110501043, 1, "", 1110501, 0, 1, 11, 0);
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", "", 0, 1110501044, "", "", 1110501, "", "", 91, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("vo_adv_1110501_002", 0, "vo_adv_1110501", 1110501045, 0, "", 1110501, "", "", 21, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 4, 111011, 1110501046, 1, "", 1110501, 0, 1, 11, 0);
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", "", 0, 1110501047, "", "", 1110501, "", "", 91, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("vo_adv_1110501_003", 0, "vo_adv_1110501", 1110501048, 0, "", 1110501, "", "", 21, "");
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 5, 111011, 1110501049, 1, "", 1110501, 0, 1, 11, 0);
